import './App.css';
import { FloatingWhatsApp } from 'react-floating-whatsapp'
import Logo from "./images/f2.png"

function App() {
  return (
    <FloatingWhatsApp 
    phoneNumber="+919042294007"
    accountName="EON8 SERVICES"
    avatar={Logo}
    allowEsc
    allowClickAway
    notification
    notificationSound
  />
  );
}

export default App;
